interface ButtonProps {
    children?: React.ReactNode;
    onClick?: () => void;
}

const ActionButton: React.FC<ButtonProps> = ({children, onClick}) => {
    return <>
        <button onClick={onClick} className='px-6 py-1.5 border rounded-lg bg-orange-500 text-white hover:bg-opacity-80 font-semibold flex'>
            { children }
        </button>
    </>
}

export default ActionButton;
